import {Grid, Cell} from 'react-mdl';


class AddBikes extends Component {
    render(){
        return(
            <div>

                <form class = "form-class">
                    <label>Add Project Name </label>
                    <input type="text"/>
                    <br/>
                    <label>Add Bikes Distributed</label>
                    <input type="text"/>
                    <br/>

                    <label>Add Season Distributed </label>
                    <input type="text"/>
                    <br/>

                    <button> Save </button> <button> Reset </button>

                </form>
            
             
            </div>
            
        )
    }
}

export default AddBikes;
